import "./Graph.css";

const Graph = () => {
    return(
        <div>
            <button color="red">1</button>
            <button color="red">2</button>
            <button color="red">3</button>
            <button color="red">4</button>
            <button color="red">5</button>
            <button color="red">6</button>
            <button color="red">7</button>
            <button color="red">8</button>
            <button color="red">9</button>
            <button color="red">10</button>
            <button color="red">11</button>
            <button color="red">12</button>
            <button color="red">13</button>
            <button color="red">14</button>
            <button color="red">15</button>
        </div>
    );
}
export default Graph;
